    height: 600px;
    margin: auto;
    margin-top: 150px;
    border-radius: 10px;
`;

const Display = styled.div`
    width: 330px;
    height: 60px;
    background-color: #eceff1;
    border-radius: 10px;
    margin: ;
`;
const Culcolator = () => {
    return (
        <StyleCulcolator>
